sys_variable_value.value:
(function execute(inputs, outputs) {
  var targetFieldMap = JSON.parse(inputs.target_field_map);
  var target_table = inputs.target_table;
  if (target_table) {
    var target_GR = new GlideRecord(target_table);
    var target_record = inputs.target_record_sysid;
    if (target_record) {
      target_GR.get(target_record);
      if (target_GR){

        // for each ev, update
        var evRec = new GlideRecord("di_extracted_value");
        evRec.addQuery("task", "=", inputs.task_id);
        evRec.query();
        while (evRec.next()) {
          var target_field = targetFieldMap[evRec.key.name];
          if (target_field) {
            gs.info("Update " + target_field + " with " + evRec.data);
            target_GR.setValue(target_field, evRec.data);
          } else {
            gs.info("Target field is not specified for key: " + evRec.key.name);
          }
        }
        // update
        gs.info("Updating");
        try {
          target_GR.update();
        } catch (ex) {
          var message = ex.message;
          gs.error("Error in system logs: " + message);
        }
      } else {
        gs.info("No target record found for: " + target_record);
      }
    } else {
      gs.info("Target record is not specified for target table: " + target_table);
    }
  } else {
    gs.info("Target table is not specified.");
  }
})(inputs, outputs);

